import React, { Fragment } from 'react';
import { Provider } from 'react-redux';
import store from './store';

import DataView from './components/DataView';

const App = (props) => {
	return (
		<Provider store={store}>
			<DataView />
			<Route exact path='/' component={DataView} />
		</Provider>
	);
};

export default App;
